{
  "translationLines": [
    {
      "lineNumber": 92641,
      "originalJapaneseLine": "「えへへー、楽しみにしてるっす」",
      "translatedEnglishLine": "\"Ehehe, I'm looking forward to it!\""
    },
    {
      "lineNumber": 92642,
      "originalJapaneseLine": "「なにが可笑しい！」",
      "translatedEnglishLine": "\"What's so funny!\""
    },
    {
      "lineNumber": 92643,
      "originalJapaneseLine": "「笑ってないっすよー。えへへー」",
      "translatedEnglishLine": "\"I'm not laughing, you know. Ehehe.\""
    },
    {
      "lineNumber": 92644,
      "originalJapaneseLine": "にこにことクルーチェは一日、",
      "translatedEnglishLine": "Smiling, Cruce spent the whole day"
    },
    {
      "lineNumber": 92645,
      "originalJapaneseLine": "サーナキアの看病をした。",
      "translatedEnglishLine": "taking care of Sarnakia."
    },
    {
      "lineNumber": 92646,
      "originalJapaneseLine": "「こらーっ！　クルーチェー！",
      "translatedEnglishLine": "\"Hey! Cruce!\""
    },
    {
      "lineNumber": 92647,
      "originalJapaneseLine": "　どこに隠れたーーー！？」",
      "translatedEnglishLine": "\"Where are you hiding!?!\""
    },
    {
      "lineNumber": 92648,
      "originalJapaneseLine": "ランス城にサーナキアの怒声が響く。",
      "translatedEnglishLine": "Sarnakia's angry shouts echoed through Rance Castle."
    },
    {
      "lineNumber": 92649,
      "originalJapaneseLine": "「よっ、はっ、とっ……」",
      "translatedEnglishLine": "\"Yo, ha, to...\""
    },
    {
      "lineNumber": 92650,
      "originalJapaneseLine": "「やばい、やばい、怒ってる。",
      "translatedEnglishLine": "\"Oh no, oh no, she's angry."
    },
    {
      "lineNumber": 92651,
      "originalJapaneseLine": "　訓練サボっただけであんなに",
      "translatedEnglishLine": "Getting that mad just because I skipped training"
    },
    {
      "lineNumber": 92652,
      "originalJapaneseLine": "　怒ることないのににゃ〜」",
      "translatedEnglishLine": "is really too much, nya~\""
    },
    {
      "lineNumber": 92653,
      "originalJapaneseLine": "「おおっと、分かれ道。",
      "translatedEnglishLine": "\"Oops, a fork in the road."
    },
    {
      "lineNumber": 92654,
      "originalJapaneseLine": "　さて、どっちに……」",
      "translatedEnglishLine": "Now then, which way...\""
    },
    {
      "lineNumber": 92655,
      "originalJapaneseLine": "「あっ……」",
      "translatedEnglishLine": "\"Ah...\""
    },
    {
      "lineNumber": 92656,
      "originalJapaneseLine": "「お？」",
      "translatedEnglishLine": "\"Oh?\""
    },
    {
      "lineNumber": 92657,
      "originalJapaneseLine": "そこでバッタリ出くわした",
      "translatedEnglishLine": "At that moment, unexpectedly encountered"
    },
    {
      "lineNumber": 92658,
      "originalJapaneseLine": "ハイジ・パンクラウが",
      "translatedEnglishLine": "Heidi Pankrau"
    },
    {
      "lineNumber": 92659,
      "originalJapaneseLine": "自分の後ろに行くよう、顎をしゃくった。",
      "translatedEnglishLine": "nodded to indicate going behind him."
    },
    {
      "lineNumber": 92660,
      "originalJapaneseLine": "「にひっ」",
      "translatedEnglishLine": "\"Nihi.\""
    },
    {
      "lineNumber": 92661,
      "originalJapaneseLine": "「ふっ……」",
      "translatedEnglishLine": "\"Huh...\""
    },
    {
      "lineNumber": 92662,
      "originalJapaneseLine": "「あっ、君はメイドの……",
      "translatedEnglishLine": "\"Ah, you are one of the maids...\""
    },
    {
      "lineNumber": 92663,
      "originalJapaneseLine": "　ここにクルーチェは来なかったか？」",
      "translatedEnglishLine": "\"Did Cruce not come here?\""
    },
    {
      "lineNumber": 92664,
      "originalJapaneseLine": "「あーはいはい、",
      "translatedEnglishLine": "\"Ah, yes, yes,"
    },
    {
      "lineNumber": 92665,
      "originalJapaneseLine": "　それなら丁度今、",
      "translatedEnglishLine": "if that's the case, just now"
    },
    {
      "lineNumber": 92666,
      "originalJapaneseLine": "　あっち、あっちの方にー」",
      "translatedEnglishLine": "she went that way, that way over there.\""
    },
    {
      "lineNumber": 92667,
      "originalJapaneseLine": "（任せな。",
      "translatedEnglishLine": "(Leave it to me."
    },
    {
      "lineNumber": 92668,
      "originalJapaneseLine": "　サーナキアさんはこっちで誤魔化してあげる）",
      "translatedEnglishLine": "I'll distract Sarnakia on this side.)"
    },
    {
      "lineNumber": 92669,
      "originalJapaneseLine": "（感謝っす）",
      "translatedEnglishLine": "(Thanks a lot.)"
    },
    {
      "lineNumber": 92670,
      "originalJapaneseLine": "（ふっ、こないだの借り……",
      "translatedEnglishLine": "(Heh, the favor from last time..."
    },
    {
      "lineNumber": 92671,
      "originalJapaneseLine": "　これで返したわよ）",
      "translatedEnglishLine": "I'll repay it with this.)"
    },
    {
      "lineNumber": 92672,
      "originalJapaneseLine": "クルーチェとハイジは",
      "translatedEnglishLine": "Cruce and Heidi"
    },
    {
      "lineNumber": 92673,
      "originalJapaneseLine": "サボり仲間として仲が良かった。",
      "translatedEnglishLine": "were close as fellow slackers."
    },
    {
      "lineNumber": 92674,
      "originalJapaneseLine": "「あっはははっ、脱出せいこーう♪",
      "translatedEnglishLine": "\"Ahahaha, escape success♪"
    },
    {
      "lineNumber": 92675,
      "originalJapaneseLine": "　まだまだ甘いっすねー、団長」",
      "translatedEnglishLine": "You're still too soft, leader.\""
    },
    {
      "lineNumber": 92676,
      "originalJapaneseLine": "「さーて、今日はなにするっすかねー。",
      "translatedEnglishLine": "\"So, what shall we do today?"
    },
    {
      "lineNumber": 92677,
      "originalJapaneseLine": "　リセットちゃん達と暇潰しに遊ぼうか」",
      "translatedEnglishLine": "Shall we have some fun killing time with Reset-chan and the others?\""
    },
    {
      "lineNumber": 92678,
      "originalJapaneseLine": "クルーチェがふにゃふにゃ歩いていると、",
      "translatedEnglishLine": "As Cruce was wandering around weakly,"
    },
    {
      "lineNumber": 92679,
      "originalJapaneseLine": "後ろから声をかけられた。",
      "translatedEnglishLine": "she was called from behind."
    },
    {
      "lineNumber": 92680,
      "originalJapaneseLine": "「お嬢様！」",
      "translatedEnglishLine": "\"Milady!\""
    },
    {
      "lineNumber": 92681,
      "originalJapaneseLine": "「あり？」",
      "translatedEnglishLine": "\"Huh?\""
    },
    {
      "lineNumber": 92682,
      "originalJapaneseLine": "…………",
      "translatedEnglishLine": "........"
    },
    {
      "lineNumber": 92683,
      "originalJapaneseLine": "……",
      "translatedEnglishLine": "..."
    },
    {
      "lineNumber": 92684,
      "originalJapaneseLine": "クルーチェは、",
      "translatedEnglishLine": "Cruce,"
    },
    {
      "lineNumber": 92685,
      "originalJapaneseLine": "城の裏門で男の対応をしていた。",
      "translatedEnglishLine": "was dealing with a man at the castle's back gate."
    },
    {
      "lineNumber": 92686,
      "originalJapaneseLine": "「おお、お久しゅうございます、",
      "translatedEnglishLine": "\"Oh, long time no see,"
    },
    {
      "lineNumber": 92687,
      "originalJapaneseLine": "　クルーチェお嬢様……」",
      "translatedEnglishLine": "Milady Cruce...\""
    },
    {
      "lineNumber": 92688,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"...\""
    },
    {
      "lineNumber": 92689,
      "originalJapaneseLine": "瞳を潤ませ再会を喜ぶ、",
      "translatedEnglishLine": "With tears welling in his eyes, happy at the reunion,"
    },
    {
      "lineNumber": 92690,
      "originalJapaneseLine": "クルーチェの家に仕える執事とは対照的に、",
      "translatedEnglishLine": "in contrast to the butler who serves at Cruce's home,"
    }
  ]
}

